<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Search Details</title>
    <link rel="stylesheet" href="css/popup.css">
</head>
<body>
<div class="rectangle-1 border-class-1"></div>
<div class="group-18">
  <div class="bar-none-citations font-class-1">Bar None Citations</div>
  <div class="group-7">
    <div class="component-2-2">
      <div class="style-supreme-court font-class-1">Style: Supreme Court</div>
    </div>
    <div class="group-6">
      <img
        class="polygon-1"
        src="https://anima-uploads.s3.amazonaws.com/projects/5f981fab6395527a14058a31/releases/5f981fb2e901303153a036cc/img/polygon-1@1x.png"
      />
      <img
        class="polygon-2"
        src="https://anima-uploads.s3.amazonaws.com/projects/5f981fab6395527a14058a31/releases/5f981fb2e901303153a036cc/img/polygon-2@1x.png"
      />
    </div>
  </div>
  <img
    class="legal-icon"
    src="https://anima-uploads.s3.amazonaws.com/projects/5f981fab6395527a14058a31/releases/5f981fb2e901303153a036cc/img/legalicon-2@1x.png"
  />
  <div class="name font-class-1">Name:</div>
  <div class="rectangle-7 border-class-1"></div>
  <div class="page font-class-1">Page:</div>
  <div class="rectangle-8 border-class-1"></div>
  <div class="court-reporter font-class-1">Court Reporter:</div>
  <img
    class="ellipse-1"
    src="https://anima-uploads.s3.amazonaws.com/projects/5f981fab6395527a14058a31/releases/5f981fb2e901303153a036cc/img/ellipse-1@1x.png"
  />
  <div class="us font-class-1">U.S.</div>
  <img
    class="ellipse-2"
    src="https://anima-uploads.s3.amazonaws.com/projects/5f981fab6395527a14058a31/releases/5f981fb2e901303153a036cc/img/ellipse-1@1x.png"
  />
  <div class="s-ct font-class-1">S.Ct</div>
  <img
    class="ellipse-3"
    src="https://anima-uploads.s3.amazonaws.com/projects/5f981fab6395527a14058a31/releases/5f981fb2e901303153a036cc/img/ellipse-1@1x.png"
  />
  <div class="le2d font-class-1">L.E.2d</div>
  <div class="volume font-class-1">Volume:</div>
  <div class="rectangle-13 border-class-1"></div>
  <div class="year font-class-1">Year:</div>
  <div class="rectangle-14 border-class-1"></div>
  <img
    class="rectangle-15"
    src="https://anima-uploads.s3.amazonaws.com/projects/5f981fab6395527a14058a31/releases/5f981fb2e901303153a036cc/img/rectangle-15@1x.png"
  />
  <div class="generate-citation font-class-1">Generate Citation</div>
  <div class="copy-paste-citation font-class-1">Copy &amp; Paste Citation:</div>
  <div class="x font-class-1">X</div>
</div>
</body>
</html>
